I'm attempting to retrieve block details at a specific timestamp on the Mantle Mainnet, but I'm receiving a null value.

Here's the code I'm using:

```javascript
const Mantle_RPC = 'https://mainnet.telos.net/evm';
const timestamp = 1634780200;
const provider = new ethers.providers.JsonRpcProvider(Mantle_RPC);
const block = await provider.getBlockWithTransactions(timestamp);
console.log("Block:", block);
```

The result I'm getting is:

```
Block: null
```

I'm wondering why I'm not getting the expected block details at this timestamp.

